import React, { useState } from 'react';
import { Menu, Button } from 'antd';

const MyMenu = ({ models, currentModel, setModel }) => {
  const [collapsed, setCollapsed] = useState(false);
  const filterKeywords = ['llama3', 'qwen2']; // 示例过滤关键词

  const handleMenuClick = (e) => {
    setModel(e.key);
    setCollapsed(true); // 点击时收回菜单
  };

  const items = models
    .filter((model) => filterKeywords.some((keyword) => model.name.includes(keyword)))
    .map((model) => ({
      key: model.name,
      label: model.name,
    }));

  return (
    <div style={{ display: 'flex', flexDirection: 'column' }}>
      <Button onClick={() => setCollapsed(!collapsed)} style={{ marginBottom: '10px' }}>
        {collapsed ? '展开菜单' : '收回菜单'}
      </Button>
      {!collapsed && (
        <Menu
          onClick={handleMenuClick}
          style={{ width: '50%' }}
          mode="inline"
          items={[{ key: 'select-model', label: `当前模型: ${currentModel}`, children: items }]}
        />
      )}
    </div>
  );
};

export default MyMenu;
